	add("manage", "{\"term\":\"manage\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Early Modern English \u0027manage\u0027 \u0027menage\u0027 from Middle english (1100-1500) \u0027*manage\u0027 \u0027*menage\u0027 from Old french (842-ca. 1400) \u0027manege\u0027 (the handling or training of a horse, horsemanship, riding, maneuvers, proceedings) probably from Old italian \u0027maneggiare\u0027 (to handle, manage, touch, treat) from \u0027\u0027 from Latin \u0027manus\u0027 (the hand) see manual.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of managing or controlling something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, III.xii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the winged God himselfe / Came riding on a Lion rauenous, / Taught to obay the \u0027\u0027menage\u0027\u0027 of that Elfe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Young men, in the conduct and \u0027\u0027manage\u0027\u0027 of actions, embrace more than they can hold\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the unlucky \u0027\u0027manage\u0027\u0027 of this fatal braw\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Manège\", \"priority\":8}]}, \"synonyms\":{}}");

