	add("management", "{\"term\":\"management\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|manage|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Administration; the process or practice of managing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The executives of an organisation, especially senior executives\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dMr. Cooke at once began a tirade against the residents of Asquith for permitting a sandy and generally disgraceful condition of the roads. So roundly did he vituperate the inn \u0027\u0027management\u0027\u0027 in particular, and with such a loud flow of words, that I trembled lest he should be heard on the veranda\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Judicious use of means to accomplish an end\", \"priority\":4}]}, \"synonyms\":{}}");

	add("managementese", "{\"term\":\"managementese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|management|ese|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The jargon used by management\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, Kenneth Lamott, \u0026quot;The Chancellor the State Colleges,\u0026quot; \u0027Los Angeles Times\u0027, 14 Nov., p. U16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even phrased as they are in Higher \u0027\u0027Managementese\u0027\u0027, these comments touch the heart of the matter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, w:William William Safire, \u0026quot;[http://www.nytimes.com/1992/06/14/magazine/on-language-perotspeak.html?pagewanted\u003d2 On Language: Perotspeak],\u0026quot; \u0027New York Times\u0027, 14 Jun. (retrieved 14 Apr. 2009\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The uniqueness of Perotspeak is its mixture of rustic metaphor with modern \u0027\u0027managementese\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0026quot;[http://www.telegraph.co.uk/comment/telegraph-view/3577692/Silly-names-for-failure.html Silly names for failure],\u0026quot; \u0027Telegraph\u0027 (UK), 10 Jun. (retrieved 14 Apr. 2009\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Since February, we have been calling for the ridiculously named Consignia to change back to the good old Post Office. . . . [T]he chief executive, John Roberts, said of Consignia that it was a \u0026quot;modern, meaningful and entirely appropriate\u0026quot; name that \u0026quot;describes the full scope of the Post Office in a way that the words ‘post’ and ‘office’ cannot\u0026quot;. That was clearly hogwash \u0027\u0027managementese\u0027\u0027 of the worst variety\", \"priority\":7}]}, \"synonyms\":{}}");

