	add("mandarin", "{\"term\":\"mandarin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"An extension of {{m|en|mandarin||bureaucrat of the Chinese Empire}} to the language used by the imperial court and sometimes by imperial officials elsewhere.\u0026lt;!--In Chinese, this language can be described as (simplified Chinese:) 官话 / (traditional Chinese:) 官話 / (pinyin:) Guānhuà, literally \u0026quot;speech of officials\u0026quot;.--\u0026gt; As such, it was adopted as a synonym for Modern Standard Chinese in the 20th century. The term became ambiguous, however, as its use was extended to the various Northern dialects of Chinese\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Standard Mandarin, the official language of China and Taiwan, and one of four official languages in Singapore; Putonghua, Guoyu or Huay\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A branch of the Chinese languages, consisting of many dialects; Guanhua or Beifanghua\", \"priority\":2}]}, \"synonyms\":{}}");

