	add("maneating", "{\"term\":\"maneating\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|maneater|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The consumption of human flesh by animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Arjan Singh, \u0027The legend of the maneater\u0027, [http://books.google.com/books?id\u003d1HDhQVo0FzoC\u0026amp;pg\u003dPA83\u0026amp;dq\u003d%22maneating%22\u0026amp;hl\u003den\u0026amp;ei\u003drmTHTuqcCqGliQKog9m8Dw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CD0Q6AEwAg page 83\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Corbett described \u0027\u0027maneating\u0027\u0027 as the compulsive seeking of human flesh by carnivore\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Hans Kruuk, \u0027Hunter and hunted: relationships between carnivores and people\u0027, [http://books.google.com/books?id\u003dgyzIrGBrcaMC\u0026amp;pg\u003dPA75\u0026amp;dq\u003d%22maneating%22\u0026amp;hl\u003den\u0026amp;ei\u003drmTHTuqcCqGliQKog9m8Dw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CDMQ6AEwAA page 75\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In general, \u0027\u0027maneating\u0027\u0027 is only an infinitesimally small factor of mortality amongst people\", \"priority\":5}]}, \"synonyms\":{}}");

