	add("maneuver", "{\"term\":\"maneuver\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027manœuvre\u0027 (lang\u003dfrm) and \u0027manouvrer\u0027 (to maneuver) from Old french (842-ca. 1400) \u0027manovre\u0027 (handwork, manual labour) from \u0027manopera\u0027 \u0027manuopera\u0027 (work done by hand, handwork) from \u0027manu\u0027 (lang\u003dla) + \u0027operari\u0027 (lang\u003dla) First recorded in the Capitularies of Charlemagne (800 {{C.E.}}) to mean \u0026quot;chore, manual task\u0026quot;, probably as a calque of the Frankish *\u0027\u0027 (handwerc) Compare Old English \u0027handweorc\u0027 {{m|ang|handġeweorc}}, German \u0027handwerk\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A movement, often one performed with difficulty\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Parallel parking can be a difficult \u0027\u0027maneuver\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large training field-exercise of military troops\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The army was on \u0027\u0027maneuvers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Joint NATO \u0027\u0027maneuvers\u0027\u0027 are as much an exercise in diplomacy as in tactics and logistics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An adroit or cunning action; a stratagem\", \"priority\":6}]}, \"synonyms\":{}}");

	add("manfiction", "{\"term\":\"manfiction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|fiction|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Literary fiction which appeals to, or is marketed toward, men, typically written by male authors and centering on male characters\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Ben Neihart, \u0026quot;[http://www.nytimes.com/2007/03/18/magazine/18hill.t.html?ei\u003d5124\u0026amp;en\u003d9f71cbe2eb704732\u0026amp;ex\u003d1331784000 Prince of Darkness]\u0026quot;, \u0027The New York Times\u0027, 18 March 2007\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He sang the praises of Elmore Leonard, Chabon, Malamud and a host of tough-guy “\u0027\u0027manfiction\u0027\u0027” novelists, to use his affectionately satirical term\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Stephen King, \u0026quot;[http://www.ew.com/ew/article/0,,20225323,00.html Who Says Real Men Don\u0027t Read?]\u0026quot;, \u0027Entertainment Weekly\u0027, 12 October 2008\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And current \u0027\u0027manfiction\u0027\u0027 certainly gives women a better deal than they got in the pulps of yesteryear, when most were presented as barracuda debs in frilly negligees\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Amanda Hess (quoting [http://tigerbeatdown.com/2010/05/31/what-we-read-when-we-dont-read-the-internet-presents-au-revoir-pretty-horses-or-why-i-dont-read-man-books-any-more/ Tiger Beatdown]), \u0026quot;[http://www.washingtoncitypaper.com/blogs/sexist/2010/06/01/the-morning-after-manfiction-and-mandles-edition/ The Morning After: Manfiction and Mandles Edition]\u0026quot;, \u0027Washington City Paper\u0027, 1 June 2010\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A professed affinity for \u0027\u0027Manfiction\u0027\u0027 was a central tenet of this precarious Cool Girl identity; a Cool Girl was always ready to support the literary analysis presented by the dudes, even after consuming a fifth of bourbon at three in the morning\", \"priority\":7}]}, \"synonyms\":{}}");

	add("manga", "{\"term\":\"manga\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Japanese\", \"late middle chinese\"], \"text\":\"From Japanese \u0027漫画|tr\u003dmanga \u0026lt;/i\u0026gt;まんが\u0026lt;i\u0026gt;\u0027 (lang\u003dja) from Late middle chinese 漫 (\u0027màn\u0027 \u0026quot;free\u0026quot;, \u0026quot;unrestrained\u0026quot;) + 畫 (\u0027ɣwɛ̀\u0027 \u0026quot;drawing\u0026quot;) (compare Mandarin chinese 漫画|\u0027mànhuà\u0027 漫画, Korean \u0027manhwa\u0027 만화). After an 1814 book by {{w|Hokusai|Katsushika Hokusai}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A comic originating in Japan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An artistic style heavily used in, and associated with, Japanese comics, and that has also been adopted by a comparatively low number of comics from other countries\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A comic in manga style, regardless of the country of origin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Lately I\u0027ve been reading a Brazilian \u0027\u0027manga\", \"priority\":4}]}, \"synonyms\":{}}");

	add("mange", "{\"term\":\"mange\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027manjewe\u0027 \u0027manjeue\u0027 from Old french (842-ca. 1400) \u0027manjue\u0027 derived from \u0027mangier|lang\u003dfro\u0027 () (modern French \u0027manger\u0027 (to eat) , from Latin \u0027manducare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A skin disease of mammals caused by parasitic mites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mango", "{\"term\":\"mango\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malay\", \"Portuguese\", \"Tamil\"], \"text\":\"From Portuguese {{m|pt|manga}}, from Malay {{m|ms|mangga}}, from Tamil {{m|ta|மாங்காய்|sc\u003dTaml}} from {{m|ta|மா||mango species}} + {{m|ta|காய்||unripe fruit}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tropical Asian fruit tree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fruit of the mango tree\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1738\u0027\u0027, October–November, \u0027Philosophical Transactions\u0027, volume\u0026amp;nbsp;40, number\u0026amp;nbsp;450, “VI. his Answer to the Marquis de Caumont\u0027s Letter, concerning this Stone”, translated from the Latin by , (1741), [http://books.google.co.uk/books?id\u003dn-Sqv1MENJkC\u0026amp;pg\u003dRA1-PA376 page\u0026amp;nbsp;376\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And I have one [bezoar] form\u0027d round the Stone of that great Plum, which comes pickled from thence, and is called \u0027\u0027\u0027Mango\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A pickled vegetable or fruit with a spicy stuffing; a vegetable or fruit which has been mang\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"mangoed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Elizabeth E. Lea, William Woys Weaver, \u0027A Quaker Woman\u0027s Cookbook: The Domestic Cookery of Elizabeth Ellicott Lea\u0027, page 33\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In Pennsylvania and western Maryland, \u0027\u0027mangoes\u0027\u0027 were generally made with green bell peppers\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A green bell pepper suitable for pickling\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, Pennsylvania State Board of Agriculture, \u0027Agriculture of Pennsylvania\u0027, Page 22\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Mango\u0027\u0027 peppers by the dozen, if owned by the careful housewife, would gladden the appetite or disposition of any epicure or scold\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027, Ohio State Board of Agriculture, \u0027Annual Report\u0027, Page 15\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Best \u0027\u0027mango\u0027\u0027 pepper\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"lt;!-- this is a typical way of preparing a bell pepper, indicating likely to be this sense --\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Allan A. Metcalf, \u0027How We Talk: American Regional English Today\u0027, page 4\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Finally, although both the South and North Midlands are not known for their tropical climate, that\u0027s where \u0027\u0027mangoes\u0027\u0027 grow. These aren\u0027t the tropical fruit, though, but what are elsewhere called green peppers\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A type of muskmelon, \u0027Cucumis melo\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Any of various hummingbirds of the genus \u0027Anthracothorax\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"colour) A yellow-orange color, like that of mango flesh\", \"priority\":19}]}, \"synonyms\":{}}");

	add("mangu", "{\"term\":\"mangu\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"Derived from Spanish \u0027mangú\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mashed plantain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manganese", "{\"term\":\"manganese\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"French {{m|fr|manganèse}}, from Italian {{m|it|manganese}}, by alteration from Latin {{m|la|magnesia||magnesia}}, from Ancient greek (to 1453) {{m|grc|μαγνησία}}, after {{m|grc|Μαγνησία||Magnesia}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A metallic chemical element (\u0027symbol\u0027 Mn) with an atomic number of 25\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/in-the-news-47 In the passage\u003dOxygen levels on Earth skyrocketed 2.4 billion years ago, when cyanobacteria evolved photosynthesis:. The evolutionary precursor of photosynthesis is still under debate, and a new study sheds light. The critical component of the photosynthetic system is the \u0026amp;ldquo;water-oxidizing complex\u0026amp;rdquo;, made up of \u0027\u0027manganese\u0027\u0027 atoms and a calcium atom\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manganium", "{\"term\":\"manganium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"manganese\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manganometry", "{\"term\":\"manganometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mangano|metry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An analytical technique that involves redox titration using potassium permanganate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manganonaujakasite", "{\"term\":\"manganonaujakasite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mangano|naujakasite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic bright blue mineral containing aluminum, iron, manganese, oxygen, silicon, and sodium\", \"priority\":1}]}, \"synonyms\":{}}");

