	add("manger", "{\"term\":\"manger\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027mangoire\u0027 () \u0027menjoere\u0027 () from \u0027mangier\u0027 (lang\u003dfro) (modern French \u0027manger\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A trough for animals to eat from\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mangiferin", "{\"term\":\"mangiferin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The glycoside \u00272-β-D-glucopyranosyl-1,3,6,7-tetrahydroxyxanthen-9-one\u0027 that has some use as an antioxidant. It is a glucoside of norathyriol\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manglish", "{\"term\":\"manglish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|Malaysia|English|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An English-based creole spoken in Malaysia, incorporating words from Malay and other mostly Asian languages\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mangrove", "{\"term\":\"mangrove\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Portuguese\", \"taino\"], \"text\":\"Circa 1610, corruption of earlier \u0027mangrow\u0027 by folk etymology influence of \u0027grove\u0027 from Portuguese \u0027mangue\u0027 from Spanish \u0027mangle\u0027 (or directly from Spanish), from a Caribbean language, possibly Taino another language, or a language.\u0026lt;ref\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:American Heritage 2006}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various tropical evergreen trees or shrubs that grow in shallow coastal water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A habitat with such plants; mangrove forest; mangrove swamp\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Plants of the Rhizophoraceae family\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Trees of the genus \u0027Rhizophora\", \"priority\":4}]}, \"synonyms\":{}}");

	add("manhattan", "{\"term\":\"manhattan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An indigenous people of North America who lived in present day New York State\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A borough of New York City, mainly on Manhattan Island\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manhole", "{\"term\":\"manhole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|hole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hole in the ground used to access the sewers or other underground vaults and installations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hole providing access to the inside of a boiler\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manhunt", "{\"term\":\"manhunt\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|hunt|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organized search for a criminal or enemy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After the murderer escaped, there was a full-scale \u0027\u0027manhunt\u0027\u0027 to catch him\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manhwa", "{\"term\":\"manhwa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Korean\"], \"text\":\"Korean \u0027만화\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Korean comic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Christopher Hart, \u0027Manhwa Mania: How to Draw Korean Comics\u0027, Watson-Guptill Publications (2004), ISBN 082302976X, [http://books.google.com/books?id\u003dg2pT08IP4mQC\u0026amp;pg\u003dPA7\u0026amp;dq\u003d%22In+fact,+many+manga+fans+don\u0027t+realize+that+their+favorite+comics%22 page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In fact, many manga fans don\u0027t realize that their favorite comics — such as \u0027Priest\u0027, \u0027Ragnarock\u0027, and \u0027Island\u0027 — are actually Korean \u0027\u0027manhwa\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Jason Thompson, \u0027Manga: The Complete Guide\u0027, Del Rey (2007), ISBN 9780345539441, [http://books.google.com/books?id\u003dGvEFDD4rdWMC\u0026amp;pg\u003dPT45\u0026amp;dq\u003d%22manhwa%2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22manhwa%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Since the Korean language reads left to right (unlike Chinese and Japanese), \u0027\u0027\u0027manhwa\u0027\u0027\u0027 are printed left to right in the same format as English books\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Mark James Russell, \u0027Pop Goes Korea: Behind the Revolution in Movies, Music, and Internet Culture\u0027, Stone Bridge Press (2008), ISBN 9781611725421, [http://books.google.ca/books?id\u003dgftM5SjLwV8C\u0026amp;pg\u003dPT428\u0026amp;dq\u003d%22manhwa%22 unnumbered page\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"As the best Japanese titles were mined, the American companies began to look for alternatives, and Tokyopop\u0027s founder Stuart Levy already had a budding interest in Korean \u0027\u0027manhwa\", \"priority\":8}]}, \"synonyms\":{}}");

	add("mania", "{\"term\":\"mania\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027mania\u0027 from Ancient greek (to 1453) \u0027μανία\u0027 (madness)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Violent derangement of mind; madness; insanity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Excessive or unreasonable desire; insane passion affecting one or many people; fanaticism.\u0026lt;!-- Modified Webster 1913 defs --\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/http://www.economist.com/news/business/21582001-army-new-online-courses-scaring-wits-out-traditional-universities-can-they The attack of the passage\u003dDotcom \u0027\u0027mania\u0027\u0027 was slow in coming to higher education, but now it has the venerable industry firmly in its grip. Since the launch early last year of Udacity and Coursera, two Silicon Valley start-ups offering free education through MOOCs, massive open online courses, the ivory towers of academia have been shaken to their foundations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of abnormally elevated or irritable mood, arousal, and/or energy levels\", \"priority\":4}]}, \"synonyms\":{}}");

	add("maniacality", "{\"term\":\"maniacality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being maniacal; mania\", \"priority\":1}]}, \"synonyms\":{}}");

	add("maniaphobia", "{\"term\":\"maniaphobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fear of being insan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"fear of being distraught or mentally ill\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manichaean", "{\"term\":\"manichaean\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Manichaeus|an|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A follower of Manichaeism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manichaeism", "{\"term\":\"manichaeism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Latin\", \"pahlavi\", \"classical syriac\"], \"text\":\"From Latin \u0027manichaeus\u0027 {{suffix||ism|lang\u003den}}, from Classical syriac \u0027ܡܐܢܝ ܚܝܐ|sc\u003dsyrc|tr\u003dmānī ḥayyā\u0027 (living mani) from the name of its founder, w:Mani (prophet)|Mani, from Pahlavi and Classical syriac \u0027\u0027 () (Modern Persian \u0027مانی\u0027 .\u0026lt;!-- and in modern {syr} / Northeastern Neo-Aramaic? --\u0026gt;{{rfscript|pal}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A syncretic, dualistic religion that combined elements of Zoroastrian, Christian, and Gnostic thought, founded by the Iranian prophet Mani in 3rd century AD\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dualistic philosophy dividing the world between good and evil principles, or regarding matter as intrinsically evil and mind as intrinsically good\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manicotti", "{\"term\":\"manicotti\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"Italian \u0027muffs\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Wide tubes of pasta filled with a savoury stuffing and baked in the oven\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manifestation", "{\"term\":\"manifestation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of becoming manifest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The last known \u0027\u0027manifestation\u0027\u0027 of the ghost was over ten years ago\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The embodiment of an intangible, or variable thing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This particular \u0027\u0027manifestation\u0027\u0027 resembled a young girl crying\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The symptoms or observable conditions which are seen as a result of some disease\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A pattern or logo on a sheet of glass, as decoration and/or to prevent people from accidentally walking in to it\", \"priority\":6}]}, \"synonyms\":{}}");

	add("manifesto", "{\"term\":\"manifesto\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"Since the mid 17th century, from Italian from \u0027manifestare\u0027 from Latin \u0027manifesto\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A public declaration of principles, policies, or intentions, especially that of a political party\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A creed is a \u0027\u0027manifesto\u0027\u0027 of religious or spiritual beliefs\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manifoldness", "{\"term\":\"manifoldness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|manifold|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being manifold, diversity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"multiplicit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A generalized concept of magnitude\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manila", "{\"term\":\"manila\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"Tagalog\"], \"text\":\"Tagalog \u0027maynila\u0027 from \u0027may nilad\u0027 (\u0027may\u0027 (there is) \u0027nilad\u0027 a kind of flowering plant once found in the low-lying banks of the Pasig River), probably under influence via Spanish from \u0027امان الله\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The capital of the Philippines, located on the island of Luzon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manila", "{\"term\":\"manila\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027Manila\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fiber made from abaca (Manila hemp), used to make ropes and manila paper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The yellow-brown colour of manila\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manileño", "{\"term\":\"manileño\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Tagalog\"], \"text\":\"From Tagalog\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the ethnic group native to Manila\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Denise Weldon, Neal M Oshima, LJC Restaurant Group, \u0027Malate: a matter of taste\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Manileños\u0027\u0027 needed a break from the Imeldific extravaganzas. They hankered for a spontaneous and casual lifestyle, which they could not find in the five-star hotels...Category:English terms spelled with Ñ\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manille", "{\"term\":\"manille\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\"], \"text\":\"From French \u0027manille\u0027 influenced by Spanish \u0027manilla\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The second-highest trump in certain card games\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A card game played with a deck of 32, in which the ten (or ‘manille’) is the highest in each suit\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manimal", "{\"term\":\"manimal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|animal|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fanciful life form that is part human and part beast; a creature recognizable as human but possessing physical or primitive behavioral characteristics that are exclusive to animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 January 1, Christopher Miles, “Kori Newkirk; the project”, \u0027Artforum International Magazine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Standing naked against a wintry landscape, the figure became a screen for the projection of identities--beast, bigfoot, \u0027\u0027manimal\u0027\u0027, specter, even, to use a word Newkirk\u0027s work encourages one to use in all its dangerousness, spook\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 February 1, Paul Z. Myers, \u0027Pharyngula\u0027, ScienceBlog\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"President panders to anti-\u0027\u0027manimal\u0027\u0027 lobby! Dr Moreau flees country in rage\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 February 4, Charlie Pierce, \u0027Wait Wait... Don\u0027t Tell Me!\u0027, National Public Radi\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Two years ago we were going to Mars, and that sort of didn\u0027t happen\u0027...\u0027and now there\u0027s, like, \u0027\u0027manimal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person compared to such a creature, especially an unkempt and uncivilized, or strong and sexually aggressive man\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 January 1, Michael Burnett, “Tumyeto army”, \u0027Thrasher\u0027, High Speed Productions, Inc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Layton smacked his head hard on a front feeble, but bounced back up to get the make. That kid\u0027s a \u0027\u0027manimal\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;Oh, he\u0027s so on the team,\u0026quot; Diego kept saying\", \"priority\":11}]}, \"synonyms\":{}}");

	add("manioc", "{\"term\":\"manioc\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"middle french (ca. 1400-1600)\", \"tupí\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027manioc\u0027 and Spanish \u0027mandioca\u0027 ultimately from Tupí \u0027manioka\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tropical plant, \u0027Manihot esculenta\u0027, from which cassava and tapioca are prepared\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Cassava root, eaten as a food\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A food starch prepared from the root\", \"priority\":3}]}, \"synonyms\":{}}");

	add("maniple", "{\"term\":\"maniple\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From the Middle english (1100-1500) \u0027maniple\u0027 \u0027manyple\u0027 \u0027manaple\u0027 from the Old french (842-ca. 1400) \u0027maniple\u0027 \u0027manipule\u0027 (\u0027manipule\u0027 in Modern French , from the Latin \u0027manipulus\u0027 (handful”, “troop of soldiers) from \u0027manus\u0027 (hand) + the weakened root of \u0027pleō\u0027 (i fill)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A handful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A division of the Roman army numbering 60 or 120 men exclusive of officers, any small body of soldiers; a company\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Originally, a napkin; later, an ornamental band or scarf worn upon the left arm as a part of the vestments of a priest in the Roman Catholic Church, and sometimes worn in the English Church service\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manipulability", "{\"term\":\"manipulability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being manipulable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manipulation", "{\"term\":\"manipulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027manipule\u0027 (from Latin \u0027manipulus\u0027) + \u0027-ation\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of manipulating or the state of being manipulated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The dealer\u0027s \u0027\u0027manipulations\u0027\u0027 could have removed cards from the deck\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The skillful use of the hands in, for example, chiropractic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"After a few minutes of \u0027\u0027manipulation\u0027\u0027 each week, she obtained days of relief from her neck pain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The management of some situation, especially for one’s own advantage\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He found that the new manager was known for his Machiavellian \u0027\u0027manipulations\u0027\u0027 in his last two positions\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The usage of psychological influence over a person or situation to gain an outcome\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The counselor was able to reach the disturbed teen through positive psychological \u0027\u0027manipulation\", \"priority\":8}]}, \"synonyms\":{}}");

	add("manism", "{\"term\":\"manism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027manes\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"ancestor-worship\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manitoba", "{\"term\":\"manitoba\", \"etymology\":{\"influencers\":[], \"languages\":[\"Cree\", \"English\", \"Ojibwe\"], \"text\":\"* From Ojibwe \u0027manito-bah\u0027 or Cree \u0027manito-wapow\u0027, \u0026quot;spirit strait\u0026quot;, referring to the Narrows of Lake Manitoba. Compare English manitou, Ojibwe manidoo.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A province in Western Canada\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manitou", "{\"term\":\"manitou\", \"etymology\":{\"influencers\":[], \"languages\":[\"pidgin delaware\", \"English\", \"munsee\", \"unami\"], \"text\":\"From Pidgin delaware \u0027manétto\u0027 from Unami \u0027manëtu\u0027 () ({{IPAchar|manətːu|lang\u003dunm}}) and Munsee \u0027manutoow\u0027 (later influenced by French \u0027manitou\u0027 from Montagnais); from Proto-algonquian {{m|alg-pro|*maneto·wa||supernatural being}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A god or spirit as the object of religious awe or ritual among some American Indians\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1826\u0027\u0027, James Fenimore Cooper, \u0027The Last of the Mohicans\u0027, 1888 p. 319\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If it were possible to translate the comprehensive and melodious language in which he spoke, the ode might read something like the following: \u0026quot;\u0027\u0027Manitou\u0027\u0027! Manitou! Manitou! Thou art great, thou art good, thou art wise: Manitou! Manitou! Thou art just.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, John A Grim, \u0027The Shaman\u0027, p. 143\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Each Ojibway shaman\u0027s method of communication with the \u0027\u0027manitou\u0027\u0027 patron is unique and is related to a personal dream experience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027Three Day Road\u0027, Penguin 2008, p. 43\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"My father strung it high in a tree for the \u0027\u0027\u0027manitous\u0027\u0027\u0027 to watch over\", \"priority\":7}]}, \"synonyms\":{}}");

	add("mankind", "{\"term\":\"mankind\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"middle high german (ca. 1050-1500)\", \"Icelandic\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027mankinde\u0027 \u0027mankende\u0027 \u0027mankunde\u0027 \u0027mankuinde\u0027 alteration (due to \u0027kinde\u0027 \u0027kunde\u0027 (kind, nature, sort) of earlier \u0027mankin\u0027 \u0027mankun\u0027 \u0027mancun\u0027 (mankind) from Old english (ca. 450-1100) \u0027mancynn\u0027 equivalent to {{compound|man|kin|lang\u003den}}, and/or {{suffix|man|kind|lang\u003den}}. Cognate with Scots \u0027mankind\u0027 Middle high german (ca. 1050-1500) \u0027mankünne\u0027 Danish \u0027mandkøn\u0027 Swedish \u0027mankön\u0027 Icelandic \u0027mannkyn\u0027 (mankind) See also {{l|en|mankin}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The human race in its entirety\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL4103950W Internal passage\u003dMore than a mere source of Promethean sustenance to thwart the cold and cook one\u0027s meat, wood was quite simply \u0027\u0027mankind\u0027s\u0027\u0027 first industrial and manufacturing fuel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Men collectively, as opposed to all women\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"“[…] it is not fair of you to bring against \u0027\u0027mankind\u0027\u0027 double weapons\u0026amp;thinsp;! Dangerous enough you are as woman alone, without bringing to your aid those gifts of mind suited to problems which men have been accustomed to arrogate to themselves\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Human feelings; humanity\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mankini", "{\"term\":\"mankini\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|bikini|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of sling bikini worn by men\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manliness", "{\"term\":\"manliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|manly|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Set of qualities, traits and abilities considered appropriate to man; similarity to man\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Male genitals\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manna", "{\"term\":\"manna\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"Hebrew\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) from \u0027manna\u0027 from Ancient greek (to 1453) \u0027μάννα\u0027 from Hebrew \u0027מן|tr\u003dmān\u0027 (\u0027manna)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Food miraculously produced for the Israelites in the desert in the book of Exodus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"By extension, any good thing which comes into one\u0027s hands by luck or good fortune\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The sugary sap of the manna gum tree which oozes out from holes drilled by insects and falls to the ground around the tree.[http://www.museum.vic.gov.au/forest/plants/gum.html\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, Bill Beatty, \u0027Tales of Old Australia\u0027, National Distributors, ISBN 1-86436-013-5, page 14, discussing old Australian foods \u0026lt;!-- no publication year given for this edition, first edition was 1966 --\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The icing on the cake was made from manna, which was gathered under the manna gums. Manna mixed with milk made a splendid icing\", \"priority\":5}]}, \"synonyms\":{}}");

	add("manny", "{\"term\":\"manny\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|male|nanny|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male nanny\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 [Perry Taylor] has popped up in supermarket tabloids as the male nanny \u0026amp;ndash; or \u0026quot;manny\u0026quot; \u0026amp;ndash; for Britney Spears, who has a 9-month-old son, Sean Preston and is pregnant. \u0026amp;mdash; [http://www.cbsnews.com/stories/2006/06/09/entertainment/main1698355.shtml?source\u003dRSS\u0026amp;attr\u003dEntertainment_1698355 CBS News], 9 June 2006\", \"priority\":2}]}, \"synonyms\":{}}");

