	add("mannitose", "{\"term\":\"mannitose\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mannite|ose|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sugar obtained by partial oxidation of mannite, and closely resembling levulose\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mannosulfan", "{\"term\":\"mannosulfan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular drug used in the treatment of cancer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manodanda", "{\"term\":\"manodanda\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|sa|मनोदण्ड||complete control over one\u0027s thoughts|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"complete control over one\u0027s thought\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"mental deed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"mental punishments in the Indosphere, such as being cursed\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manometer", "{\"term\":\"manometer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027manomètre\u0027 formed from Ancient greek (to 1453) \u0027μανός\u0027 (thin, rare) + \u0027μέτρον\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instrument to measure pressure in a fluid, especially a double-legged liquid column gauge used to measure the difference in the pressures of two fluids\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1872\u0027\u0027, \u0027The American Journal of Science\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As soon as the \u0027\u0027manometer\u0027\u0027 of the pump indicated the maximum of rarification, the apparatus was inclined\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Thomas Pynchon, \u0027Gravity’s Rainbow\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Pökler helped in working out the Halbmodelle solution: bisecting the model lengthwise and mounting it flat-side to the wall of the test chamber, bringing the tubes through that way to all the \u0027\u0027manometers\u0027\u0027 outside\", \"priority\":5}]}, \"synonyms\":{}}");

	add("manorexia", "{\"term\":\"manorexia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|anorexia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"anorexia nervosa (or any similar eating disorder) when occurring in a male\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manorialism", "{\"term\":\"manorialism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|manorial|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political, economic and social system in medieval and early modern Europe; originally a form of serfdom but later a looser system in which land was administered via the local manor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manosphere", "{\"term\":\"manosphere\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027man\u0027 + \u0027-o-\u0027 + \u0027-sphere\u0027 after the pattern of \u0027blogosphere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The totality of men\u0027s-rights-oriented blogs and websites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manpack", "{\"term\":\"manpack\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|man|pack|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An object meant to be carried by a single person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We decide to stop in Chemainus for lunch, so we tie up at the public wharf, set security, grab the \u0027\u0027manpacks\u0027\u0027, and stroll into the pretty little town... enjoying the stretch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The operating voltage for the \u0027\u0027manpack\u0027\u0027 radio is 13.5 volts from the primary battery\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Modern tactical radios utilize a single receiver/transmitter for all \u0027\u0027manpack\u0027\u0027 and vehicular configurations. \u0027\u0027Manpacks\u0027\u0027 are limited to battery power and typically have a shorter transmission distance than the more powerful vehicular installations because of additional power amplifiers. \u0027\u0027Manpacks\u0027\u0027 are typically employed in dismounted operations where vehicular systems are used in support of mounted or dismounted forces. Multiband \u0027\u0027manpack\u0027\u0027 systems will generally shorten battery life quicker than single channel tactical radios, and perform better with stable or regulated power sources\", \"priority\":4}]}, \"synonyms\":{}}");

	add("manpanzee", "{\"term\":\"manpanzee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|chimpanzee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A humanzee\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manpower", "{\"term\":\"manpower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"man + power\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The total number of all available workers; the workforce\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The power exerted by a single person (analogous to horsepower\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manquelling", "{\"term\":\"manquelling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"murder; homicide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manroot", "{\"term\":\"manroot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|root|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flowering plant in the gourd family (Cucurbitaceae), genus \u0027Marah\u0027, native to western North America\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of two species of morning glor\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mansi", "{\"term\":\"mansi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of an ethnic group of people who live in Khantia-Mansia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Finno-Ugric language spoken by these people\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manservant", "{\"term\":\"manservant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|servant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male servant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I asked my \u0027\u0027manservant\u0027\u0027 to attend to the washing and cleaning\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027 \u0027Six days thou shalt labour, and do all thy work: But the seventh day is the sabbath of the LORD thy God: in it thou shalt not do any work, thou, nor thy son, nor thy daughter, nor thy \u0027\u0027manservant\u0027\u0027, nor thy maidservant, nor thine ox, nor thine ass, nor any of thy cattle, nor thy stranger that is within thy gates; that thy \u0027\u0027manservant\u0027\u0027 and thy maidservant may rest as well as thou.\u0027 Deuteronomy 5:12-13 KJV\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manship", "{\"term\":\"manship\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027manship\u0027 (position of honor; respect; courtesy; manly spirit or conduct; humanity; human condition) from Old english (ca. 450-1100) \u0027manscipe\u0027 (humanity, courtesy) equivalent to {{suffix|man|ship|lang\u003den}}. Cognate with Dutch \u0027manschap\u0027 (homage, manred, crew) German \u0027mannschaft\u0027 (team, crew, squad, force) Swedish \u0027manskap\u0027 (rank, crew)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being a man; maleness; masculinity; manliness; manhood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1845\u0027\u0027, Orestes Augustus Brownson, \u0027Charles Elwood\u0027, p. 161\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Every man is a man if he chooses to be, and has in himself all that he needs in order to be a man in the full significance of the term; and therefore no one has any occasion to borrow a part of his \u0027\u0027manship\u0027\u0027 from his brother\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, Lebbeus Harding Rogers, \u0027The Kite Trust (a Romance of Wealth)\u0027, p. 324\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He certainly had nothing to do with the choosing of his \u0027\u0027manship\u0027\u0027, any more than his sister had of her womanhood\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Leon Dash, \u0027When Children Want Children: The Urban Crisis of Teenage Childbearing\u0027, p. 200\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They were middle-class and, therefore, \u0026quot;had a better attitude towards girls because boys [in Washington Highlands] like beating girls to show their \u0027\u0027manship\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Kevin P. Novak, \u0027Adam Versus Adam\u0027, p. 69\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027manship\u0027\u0027 of Jesus was hid from the eyes of men as completely as the Godship\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"position of honor or respect; dignity, worthines\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"honor shown to a person; homage, respect; courtes\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"manly spirit or conduct; courage, valor, gallantry; chivalr\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"human conditio\", \"priority\":13}]}, \"synonyms\":{}}");

	add("mansion", "{\"term\":\"mansion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"Anglo-norman from Latin \u0027mansiō\u0027 (dwelling, stopping-place) from the past participle stem of \u0027manēre\u0027 (stay)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large house or building, usually built for the wealthy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A luxurious flat (apartment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A house provided for a clergyman; a manse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A stopping-place during a journey; a stage\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An astrological house; a station of the moon\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Late 14th century: Which book spak muchel of the operaciouns / Touchynge the eighte and twenty \u0027\u0027mansiouns\u0027\u0027 / That longen to the moone — Geoffrey Chaucer, ‘The Franklin\u0027s Tale’, \u0027Canterbury Tales\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One of twenty-eight sections of the sky\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An individual habitation or apartment within a large house or group of buildings. (Now chiefly in allusion to John 14:2\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027, \u0027Bible\u0027, Authorized (King James) Version, John XIV.2\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In my Father\u0027s house are many \u0027\u0027mansions\u0027\u0027 : if it were not so, I would have told you\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Denha\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"These poets near our princes sleep, / And in one grave their \u0027\u0027mansions\u0027\u0027 keep\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027The Economist\u0027, (subtitle), 18 Dec 2003\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The many \u0027\u0027mansions\u0027\u0027 in one east London house of God\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Any of the branches of the Rastafari movement\", \"priority\":15}]}, \"synonyms\":{}}");

	add("mansionization", "{\"term\":\"mansionization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mansion|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of demolishing smaller, older houses in a neighbourhood and replacing them with new ones that occupy the maximum amount of lot space possible and dwarf surrounding dwellings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Katherine Hall Page, \u0027The Body in the Lighthouse\u0027, Avon Books (2003), ISBN 0380813866, [http://books.google.com/books?id\u003dk71dbc2BHZYC\u0026amp;pg\u003dPA33 page 33\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Mansionization\u0027\u0027,\u0026quot; Faith said. \u0026quot;It\u0027s happening all over the country. Even in Aleford. Remember that sweet little Cape on River Street? Now it\u0027s a six-bedroom, six-and-a-half-bath Colonial on steroids, with great room, gym, home theater, and wine cellar.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manslut", "{\"term\":\"manslut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|slut|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A womanizer, lothario, a promiscuous ma\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Red Jordan Arobateau, \u0027Street of dreams\u0027, [http://books.google.com/books?id\u003dxXgAglkIp9MC\u0026amp;pg\u003dPA78\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CF8Q6AEwCQ page 78\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m raping you \u0027\u0027manslut\u0027\u0027.\u0026quot; A smile of satisfaction on her lips as she rapes me with her phallus nightstick\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027Details\u0027: Volume 22, Issues 7-10, [http://books.google.com/books?id\u003ds-44AQAAIAAJ\u0026amp;q\u003dmanslut\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqvN_T_X7BOq0iQK8iu35Ag\u0026amp;ved\u003d0CD8Q6AEwAzgK link\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A zit, after all, isn\u0027ta cold sore on your lip, making you look like a diseased \u0027\u0027manslut\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Stefan G. Bucher, \u0027All Access: The Making of Thirty Extraordinary Graphic Designers\u0027, [http://books.google.com/books?id\u003djDYo4qOxFacC\u0026amp;pg\u003dRA8-PT29\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CDwQ6AEwAg link\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Tommy in the novel is a pansexual pill-popping \u0027\u0027manslut\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Ryan Spear, \u0027Mikey Jr.: A Script\u0027, [http://books.google.com/books?id\u003dyGxgtoKeeAsC\u0026amp;pg\u003dPA32\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CEcQ6AEwBA page 32\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You\u0027re right, before everything that happened this morningI did plan on marrying you, having children with you, and starting a family, but that was all before I found out that I\u0027m engaged to the world\u0027s biggest \u0027\u0027manslut\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Joshilyn Jackson, \u0027Backseat Saints\u0027, [http://books.google.com/books?id\u003drKNgpIpk00sC\u0026amp;pg\u003dPT43\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CDYQ6AEwAQ link\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Tre is a manslut\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Emma Forest, Your Voice in My Head: A Memoir, [http://books.google.com/books?id\u003dZWKrLp_KazgC\u0026amp;pg\u003dPT134\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CDAQ6AEwAA link\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"GH is an unwashed \u0027\u0027manslut\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Lisa Marie Rice, \u0027Nightfire: A Protectors Novel: Marine Force Recon\u0027, [http://books.google.com/books?id\u003dzu4oxuQOLUkC\u0026amp;pg\u003dPT168\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CEIQ6AEwAw link\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"For the Mike they knew, formerly known as the “\u0027\u0027manslut\u0027\u0027,” this behavior was incomprehensible\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Amy Lane, \u0027Super Sock Man\u0027, [http://books.google.com/books?id\u003dJ9QBNjhJPU4C\u0026amp;pg\u003dPA3\u0026amp;dq\u003dmanslut\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyfF_T7aQKPDYiQK0xJyFAw\u0026amp;ved\u003d0CEwQ6AEwBQ page 3\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"And he\u0027s a real \u0027\u0027manslut\u0027\u0027, too. He must pick up a different guy a week\", \"priority\":17}]}, \"synonyms\":{}}");

	add("mansonite", "{\"term\":\"mansonite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Manson|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A follower of w:Charles Charles Manson (born 1934), American leader of a cult-like criminal group in the 1960s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Alexander Walker, \u0027Double takes: notes and afterthoughts on the movies, 1956-76\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The glib interpretations offered — the \u0027\u0027Mansonites\u0027\u0027 were all people with grudges against society: he had, like Hitler, an incomplete personality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fan of controversial American rock musician w:Marilyn Marilyn Manson (Brian Warner, born 1969\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027SPIN\u0027 magazine (volume 10, number 6, September 1994\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Today\u0027s wet-behind-the-ears \u0027\u0027Mansonites\u0027\u0027 are fueled by the spirit of betrayal, the sense that somewhere along the line the Woodstock generation copped out\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Bhesham R. Sharma, \u0027The death of art\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"By the end, she has become a \u0027\u0027Mansonite\u0027\u0027 Goth\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Raven Digitalis, \u0027Goth Craft: The Magickal Side of Dark Culture\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"For most \u0027\u0027Mansonites\u0027\u0027, Goth is only a phase, and their fashion and outlook on life change alongside Marilyn Manson\u0027s\", \"priority\":10}]}, \"synonyms\":{}}");

	add("manspreading", "{\"term\":\"manspreading\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|spreading|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of men splaying their legs open wide when sitting on public transport, thus occupying more than one seat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Emma G. Fitzsimmons, \u0026quot;[http://www.nytimes.com/2014/12/21/nyregion/MTA-targets-manspreading-on-new-york-city-subways.html?_r\u003d0 A Scourge Is Spreading. M.T.A.’s Cure? Dude, Close Your Legs]\u0026quot;, \u0027The New York Times\u0027, 20 December 2014\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The new ads — aimed at curbing rude behavior like \u0027\u0027manspreading\u0027\u0027 and wearing large backpacks on crowded trains — are set to go up in the subways next month\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Margaret Wente, \u0026quot;[http://www.theglobeandmail.com/globe-debate/advice-to-younger-women-practise-manning-up/article22383707/ Advice to younger women: Practise manning up]\u0026quot;, \u0027The Globe and Mail\u0027, 10 January 2015\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Manspreading\u0027\u0027 is certainly bad manners in a crowded subway – and so is other stuff, like people wielding giant backpacks\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Natasha Devon, \u0026quot;[http://www.independent.co.uk/life-style/health-and-families/features/the-rise-of-stranger-shaming-how-humiliating-others-became-acceptable-9982260.html The rise of stranger shaming: How humiliating others became acceptable]\u0026quot;, \u0027The Independent\u0027, 16 January 2015\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Twitter, Snapchat and Instagram show thousands pictures of men engaging in this behaviour, and New York\u0027s transit authority launched a campaign against \u0027\u0027manspreading\u0027\u0027, with a Tumblr dedicated: Men Taking Up Too Much Space On The Train\", \"priority\":7}]}, \"synonyms\":{}}");

	add("manstealer", "{\"term\":\"manstealer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|man|stealer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slave-dealer; someone who seizes another person to hold that person as a slave or sell that person into slavery; \u0027more loosely:\u0027 a slaveholder\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mansuetude", "{\"term\":\"mansuetude\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Via Middle french (ca. 1400-1600) \u0027mansuetude\u0027 or directly from Latin {{m|la|mansuētūdō}}, from {{m|la|mansuētus}}, perfect passive participle of {{m|la|mansuēscō||I tame}}, from \u0027manus\u0027 (hand) + {{m|la|suēscō||become accustomed}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gentleness, tameness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Patrick O\u0027Brian, \u0027Post Captain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Quo me rapis? Quo indeed. My whole conduct, meekness, \u0027\u0027mansuetude\u0027\u0027, voluntary abasement, astonishes me\", \"priority\":3}]}, \"synonyms\":{}}");

	add("manti", "{\"term\":\"manti\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the four Nephite spies in the Book of Mormon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A city in Utah\", \"priority\":2}]}, \"synonyms\":{}}");

	add("manteau", "{\"term\":\"manteau\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027manteau\u0027 (mantle) Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cloak or gown, especially of a kind popular with women in the 17th and 18th centuries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 915\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not to mention the need to keep her \u0027\u0027manteau\u0027\u0027 from becoming a sort of \u0027anti-parachute\u0027 which sought to lift her free of the pavement\", \"priority\":3}]}, \"synonyms\":{}}");

	add("mantelet", "{\"term\":\"mantelet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, They bring forward \u0027\u0027mantelets\u0027\u0027 and pavisses, and the archers muster on the skirts of the wood like a dark cloud before a hailstorm. — Walter Scott, \u0027Ivanhoe\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mantelpiece", "{\"term\":\"mantelpiece\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027mantel\u0027 + \u0027piece\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shelf that is affixed to the wall above a fireplace\", \"priority\":1}]}, \"synonyms\":{}}");

	add("manticism", "{\"term\":\"manticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mantic|ism|t1\u003dpertaining to divination or prophecy|t2\u003dtendency of behaviour or action|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, “Prophecy”, essay iii in \u0027Aids to Faith\u0027, ed. w:William Thomson William Thomson, § 1, [http://books.google.co.uk/books?id\u003dFx8_AAAAYAAJ\u0026amp;pg\u003dPA81\u0026amp;dq\u003dmanticism\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJsT4U4aaEoye7Abbu4DgBA\u0026amp;ved\u003d0CCIQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dmanticism\u0026amp;f\u003dfalse page 81\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It is useless…to go to the \u0027\u0027manticism\u0027\u0027 of the heathen to get light as to the nature of Hebrew prophecy\", \"priority\":4}]}, \"synonyms\":{}}");

	add("manticore", "{\"term\":\"manticore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Latin \u0027\u0027mantichora|mantichōra\u0027\u0027, from Greek \u0027\u0027μαντιχώρας\u0027\u0027 (\u0027mantichōras\u0027), \u0027\u0027μαρτιχόρας\u0027\u0027 (\u0027martichoras\u0027), \u0027\u0027μαρτιοχώρας\u0027\u0027 (\u0027martiochōras\u0027) \u0026quot;man-eater, tiger\u0026quot;, from Old Persian \u0027*martya-χvāra\u0027 \u0026quot;man-eater\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Persian mythology\u0027), A beast with the body of a lion (usually red), the tail of a scorpion, and the head/face of a man with a mouth filled with multiple rows of sharp teeth (like a shark), said to be able to shoot spikes from its tail or mane to paralyse prey. May be horned, winged, or both; its voice is described as a mixture of pipes and trumpets\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mantit", "{\"term\":\"mantit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|man|tit|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man\u0027s breast, pectoral, or nipple\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mantlet", "{\"term\":\"mantlet\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From \u0027mantellettum\u0027 (short mantle) and its source, Anglo-norman \u0027mantelet\u0027 Old french (842-ca. 1400) \u0027mantelet\u0027 diminutive of \u0027mantel\u0027 (mantle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short sleeveless cloak or cape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A portable screen or other covering, especially as used to protect the approach of soldiers engaged in a siege\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027A Storm of Swords\u0027, Bantam 2011, p. 947\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Already their archers were stealing forward, pushing their rolling \u0027\u0027mantlets\", \"priority\":4}]}, \"synonyms\":{}}");

	add("mantou", "{\"term\":\"mantou\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From Mandarin chinese \u0027饅頭\u0027 (lang\u003dcmn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Chinese steamed bun (without any filling\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mantrip", "{\"term\":\"mantrip\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A for transporting down into an underground mine\", \"priority\":1}]}, \"synonyms\":{}}");

